import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { ListeJeux, FiltreJeux, Infos, Header, Footer } from './components';
import './index.scss';

class App extends Component{

  render(){
    return (
      <div>
        <Header />
        <div className="recherche row">
          <Infos />
        </div>  
      <Footer />
      </div>

    );
  }
}
export default App;
